import React from "react";
import ReleaseNotesSection from "./component/ReleaseNotesSection";

const ReleaseNotes = () => {
  const releaseNotes = [
    {
      releaseDate: "2023-02-09T14:09:27.491Z",
      details: [],
      _id: "6204e9c66a7f8d0c68b58458",
      title: "This is where the magic happens!!",
      customHTML:
        "<img src= 'https://media.giphy.com/media/MDJ9IbxxvDUQM/giphy.gif' />",
      isPublic: true,
    },
  ];

  return (
    <React.Fragment>
      <h1>{"Welcome To Assessment Admin Portal!"}</h1>
      {releaseNotes.map((note) => {
        return <ReleaseNotesSection releaseNote={note} />;
      })}
    </React.Fragment>
  );
};

export default ReleaseNotes;
